const keypad = [
	[1, 2, 3],
	[4, 5, 6],
	[7, 8, 9],
];

// path = `ULL
// RRDDD
// LURDL
// UUUUD
// `;
path = `




`;
// const path = [
// 	[ "U", "L", "L" ],
// 	[ "R", "R", "D", "D", "D" ],
// 	[ "L", "U", "R", "D", "L" ],
// 	[ "U", "U", "U", "U", "D" ],
// ];

const startpos = { x: 1, y: 1 };


let pos = Object.assign({}, startpos);
// console.log("Starting on:", keypad[pos.y][pos.x]);
path.split("").forEach((move) => {
	const lpos = Object.assign({}, pos);
	switch(move) {
		case "U":
			pos.y -= 1;
			break;
		case "R":
			pos.x += 1;
			break;
		case "D":
			pos.y += 1;
			break;
		case "L":
			pos.x -= 1;
			break;
		case String.fromCharCode(10):
			console.log("\t*", pos, keypad[pos.y][pos.x]);
			break;
	}
	if (pos.x > 2 || pos.x < 0 || pos.y > 2 || pos.y < 0) { pos = Object.assign({}, lpos); }

});